import React from 'react';
import ReactDOM from 'react-dom'

import logo from './logo.svg';
import './App.css';

function Test(props) {
  return (
    <div>
      <p>It is currently: {props.date.toLocaleTimeString()}.</p>
    </div>
  );
}

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {date: new Date()};
  }

  render() {
    return (
      <div>
        <h1>Hello, world!</h1>
        <h2>It is {this.props.date.toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

function App() {
  return (
    <div>
      <p>Head: </p>
      <Clock />
    </div>
  );
}

setInterval(App, 1000);

export default App;
